import React from 'react';

// Import Image
import Image from '../assets/img/house-banner.png'

// Import components
import Search from '../components/Search';
const Banner = () => {
  return <section>
    <div>
      <div>
        <h1><span>Rent</span> Your Dream House With Us.</h1>
        <p>
        Nunc vel placerat nibh. Mauris consectetur quam vel mi tincidunt, 
        sed lacinia dui finibus. Donec lacus nulla, viverra eu volutpat.
        </p>

      </div>
      {/*Image*/}
      <img src={Image} />
    </div>

  </section>;
};

export default Banner;
